import React from "react";
import Nav from "../generalLayout/nav";

import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import {
  CheckNavCompact,
  ScrollNavFunction,
} from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import MotorPageHeader from "../generalLayout/motorPageHeader";
const namePage = "Brutale 1000 RR";
const manifesto_Arr = ["THE", "FASTEST", "NAKED", "BIKE"];
const nameHeaderTitle = "rush1000/sssssss.svg";
const colorBg = "#c29b2f";
const contentHeaderContent =
  "Dragster exudes exuberance and character. Born to inspire and ready to burn the tarmac, effortlessly and carefree thanks to its smart shifting system.";
const price = "19.490";
export default function BodyBrutale1000SerieOro() {
  window.onscroll = function () {
    ScrollNavFunction();
    CheckNavCompact();
  };

  return (
    <>
      <PageName namePage={namePage} />
      <Nav />
      <MotorPageHeader
        manifesto_Arr={manifesto_Arr}
        nameHeaderTitle={nameHeaderTitle}
        titleSize="auto 25%"
        colorBg={colorBg}
        contentHeaderContent={contentHeaderContent}
        price={price}
        bgHeaderParallax="brutale1000serieoro/brutale-1000-serie-oro-xl.png"
        reveredContent={true}
      />
      <Motor3d
        imgLocate="brutale1000serieoro/brutaleSerieOro"
        nameModel="𝙈𝙫 𝘼𝙜𝙪𝙨𝙩𝙖 𝟭𝟬𝟬𝟬 𝙎𝙚𝙧𝙞𝙚 𝙊𝙧𝙤"
        price="27.5K€"
      />
    </>
  );
}
